import { atom } from "recoil";
import { useCurrentYearFactory } from "../customHooks/useCurrentYearFactory";

const current_year_number = useCurrentYearFactory();
const current_year = String()
export const Year = atom<string>({
    key: 'Year',
    default: current_year
})
